import React from 'react';
import Draw from '../common/drawer';
import { useLocation, Navigate } from 'react-router-dom';

const Home = () => {
    const location = useLocation();
    const { userData } = location.state || {};

    // Eğer userData null ise, giriş sayfasına yönlendir
    if (!userData) {
        return <Navigate to="/" />;
    }

    return (
        <div>
            <h1>Welcome, {userData.User}!</h1>
            <Draw userData={userData} />
            {/* Diğer sayfa içeriği buraya */}
        </div>
    );
};

export default Home;
